import React from "react";
import "../../Styles/Shared/PayingSimple.scss";

function PayingSimple() {
  return (
    <div className='payingSimple'>
      <div className='payImg'></div>
      <div>
        {" "}
        <h3>Go Global</h3>
        <p>Be not afraid! We'll handle the backend stuff.</p>
      </div>
    </div>
  );
}

export default PayingSimple;
